—é—á–µ–Ω–æ, –∑–∞—Å—Ç–∞–≤–ª—è–µ—Ç –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏—è —Ç–æ—á–Ω–æ —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤–æ–≤–∞—Ç—å —Ä–∞–∑–º–µ—Ä–∞–º, –æ–ø—Ä–µ–¥–µ–ª–µ–Ω–Ω—ã–º –≤—ã—à–µ –¥–ª—è –†–∞–∑–º–µ—Ä–æ–≤ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏—è –∏ –º–æ–±–∏–ª—å–Ω—ã—Ö —Ä–∞–∑–º–µ—Ä–æ–≤.','Crop Images?'=>'–ö–∞–¥—Ä–∏—Ä–æ–≤–∞—Ç—å –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏—è?','You should adjust these dimensions based on the number of columns in your gallery. This does not affect the full size lightbox images.'=>'–í—ã –¥–æ–ª–∂–Ω—ã –Ω–∞—Å—Ç—Ä–æ–∏—Ç—å —ç—Ç–∏ —Ä–∞–∑–º–µ—Ä—ã –≤ –∑–∞–≤–∏—Å–∏–º–æ—Å—Ç–∏ –æ—Ç –∫–æ–ª–∏—á–µ—Å—Ç–≤–∞ –∫–æ–ª–æ–Ω–æ–∫ –≤ –≤–∞—à–µ–π –≥–∞–ª–µ—Ä–µ–µ. –≠—Ç–æ –Ω–µ –≤–ª–∏—è–µ—Ç –Ω–∞ –ø–æ–ª–Ω–æ—Ä–∞–∑–º–µ—Ä–Ω—ã–µ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏—è –≤ –ª–∞–π—Ç–±–æ–∫—Å–µ.','Image Dimensions'=>'–†–∞–∑–º–µ—Ä—ã –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏—è','Define the maximum image size for the Gallery view. Default will use the below Image Dimensions; Random will allow you to choose one or more WordPress image sizes, which will be used for the gallery output.'=>'–û–ø—Ä–µ–¥–µ–ª–∏—Ç–µ –º–∞–∫—Å. —Ä–∞–∑–º–µ—Ä –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏—è –¥–ª—è –ø—Ä–æ—Å–º–æ—Ç—Ä–∞ –≥–∞–ª–µ—Ä–µ–∏. –ü–æ —É–º–æ–ª—á–∞–Ω–∏—é –±—É–¥—É—Ç –∏—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å—Å—è —Ä–∞–∑–º–µ—Ä—ã –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏—è, —É–∫–∞–∑–∞–Ω–Ω—ã–µ –Ω–∏–∂–µ; –°–ª—É—á–∞–π–Ω—ã–π –≤—ã–±–æ—Ä –ø–æ–∑–≤–æ–ª–∏—Ç –≤–∞–º –≤—ã–±—Ä–∞—Ç—å –æ–¥–∏–Ω –∏–ª–∏ –Ω–µ—Å–∫–æ–ª—å–∫–æ —Ä–∞–∑–º–µ—Ä–æ–≤ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–π WordPress, –∫–æ—Ç–æ—Ä—ã–µ –±—É–¥—É—Ç –∏—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å—Å—è –¥–ª—è –≤—ã–≤–æ–¥–∞ –≥–∞–ª–µ—Ä–µ–∏.','Image Size'=>'–†–∞–∑–º–µ—Ä –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏—è','Sets the space between the images (defaults to 1)'=>'–£—Å—Ç–∞–Ω–∞–≤–ª–∏–≤–∞–µ—Ç –∏–Ω—Ç–µ—Ä–≤–∞–ª –º–µ–∂–¥—É –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏—è–º–∏ (–ø–æ —É–º–æ–ª—á–∞–Ω–∏—é 1)','Automatic Layout: Margins'=>'–ê–≤—Ç–æ–º–∞—Ç–∏—á–µ—Å–∫–∞—è —Ä–∞–∑–º–µ—Ç–∫–∞: –í–Ω–µ—à–Ω–∏–µ –æ—Ç—Å—Ç—É–ø—ã','Determines how high (in pixels) each row will be. 150px is default. '=>'–û–ø—Ä–µ–¥–µ–ª—è–µ—Ç, –∫–∞–∫–æ–π –≤—ã—Å–æ—Ç—ã (–≤ –ø–∏–∫—Å–µ–ª—è—Ö) –±—É–¥–µ—Ç –∫–∞–∂–¥—ã–π —Ä—è–¥. –ü–æ —É–º–æ–ª—á–∞–Ω–∏—é 150px. ','Automatic Layout: Row Height'=>'–ê–≤—Ç–æ–º–∞—Ç–∏—á–µ—Å–∫–∞—è —Ä–∞–∑–º–µ—Ç–∫–∞: –í—ã—Å–æ—Ç–∞ —Ä—è–¥–∞','Set a delay when new images are loaded'=>'–£—Å—Ç–∞–Ω–æ–≤–∏—Ç–µ –∑–∞–¥–µ—Ä–∂–∫—É –ø—Ä–∏ –∑–∞–≥—Ä—É–∑–∫–µ –Ω–æ–≤—ã—Ö –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–π','milliseconds'=>'–º–∏–ª–ª–∏—Å–µ–∫—É–Ω–¥—ã','Lazy Loading Delay'=>'–ó–∞–¥–µ—Ä–∂–∫–∞ –æ—Ç–ª–æ–∂–µ–Ω–Ω–æ–π –∑–∞–≥—Ä—É–∑–∫–∏','Enables or disables lazy loading, which helps with performance by loading thumbnails only when they are visible. See our documentation for more information.'=>'–í–∫–ª—é—á–∞–µ—Ç –∏–ª–∏ –æ—Ç–∫–ª—é—á–∞–µ—Ç –æ—Ç–ª–æ–∂–µ–Ω–Ω—É—é –∑–∞–≥—Ä—É–∑–∫—É, –∫–æ—Ç–æ—Ä–∞—è –ø–æ–º–æ–≥–∞–µ—Ç –ø–æ–≤—ã—Å–∏—Ç—å –ø—Ä–æ–∏–∑–≤–æ–¥–∏—Ç–µ–ª—å–Ω–æ—Å—Ç—å, –∑–∞–≥—Ä—É–∂–∞—è –º–∏–Ω–∏–∞—Ç—é—Ä—ã —Ç–æ–ª—å–∫–æ —Ç–æ–≥–¥–∞, –∫–æ–≥–¥–∞ –æ–Ω–∏ –≤–∏–¥–Ω—ã. –°–º–æ—Ç—Ä–∏—Ç–µ –Ω–∞—à—É –¥–æ–∫—É–º–µ–Ω—Ç–∞—Ü–∏—é –¥–ª—è –ø–æ–ª—É—á–µ–Ω–∏—è –¥–æ–ø–æ–ª–Ω–∏—Ç–µ–ª—å–Ω–æ–π –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏–∏.','Enable Lazy Loading?'=>'–í–∫–ª—é—á–∏—Ç—å –æ—Ç–ª–æ–∂–µ–Ω–Ω—É—é –∑–∞–≥—Ä—É–∑–∫—É?','Determines the number of columns in the gallery. Automatic will attempt to fill each row as much as possible before moving on to the next row.'=>'–û–ø—Ä–µ–¥–µ–ª—è–µ—Ç –∫–æ–ª–∏—á–µ—Å—Ç–≤–æ —Å—Ç–æ–ª–±—Ü–æ–≤ –≤ –≥–∞–ª–µ—Ä–µ–µ. –ê–≤—Ç–æ–º–∞—Ç–∏–∫–∞ –ø–æ–ø—ã—Ç–∞–µ—Ç—Å—è –º–∞–∫—Å–∏–º–∞–ª—å–Ω–æ –∑–∞–ø–æ–ª–Ω–∏—Ç—å –∫–∞–∂–¥—ã–π —Ä—è–¥, –ø—Ä–µ–∂–¥–µ —á–µ–º –ø–µ—Ä–µ—Ö–æ–¥–∏—Ç—å –∫ —Å–ª–µ–¥—É—é—â–µ–º—É —Ä—è–¥—É.','The settings below adjust the basic configuration options for the gallery.'=>'–ü—Ä–∏–≤–µ–¥–µ–Ω–Ω—ã–µ –Ω–∏–∂–µ –Ω–∞—Å—Ç—Ä–æ–π–∫–∏ —Ä–µ–≥—É–ª–∏—Ä—É—é—Ç –æ—Å–Ω–æ–≤–Ω—ã–µ –ø–∞—Ä–∞–º–µ—Ç—Ä—ã –∫–æ–Ω—Ñ–∏–≥—É—Ä–∞—Ü–∏–∏ –≥–∞–ª–µ—Ä–µ–∏.','Gallery Settings'=>'–ù–∞—Å—Ç—Ä–æ–π–∫–∏ –≥–∞–ª–µ—Ä–µ–∏','Click here to Upgrade'=>'–ù–∞–∂–º–∏—Ç–µ –¥–ª—è –æ–±–Ω–æ–≤–ª–µ–Ω–∏—è','Want to make your gallery workflow and presentation even better?'=>'–•–æ—Ç–∏—Ç–µ —Å–¥–µ–ª–∞—Ç—å —Ä–∞–±–æ—á–∏–π –ø—Ä–æ—Ü–µ—Å—Å –∏ –ø—Ä–µ–∑–µ–Ω—Ç–∞—Ü–∏—é –≤–∞—à–µ–π –≥–∞–ª–µ—Ä–µ–∏ –µ—â–µ –ª—É—á—à–µ?','Watch a Video'=>'–°–º–æ—Ç—Ä–µ—Ç—å –≤–∏–¥–µ–æ','or'=>'–∏–ª–∏','Read the Documentation'=>'–ü—Ä–æ—á–∏—Ç–∞–π—Ç–µ –¥–æ–∫—É–º–µ–Ω—Ç–∞—Ü–∏—é','Need some help?'=>'–ù—É–∂–Ω–∞ –ø–æ–º–æ—â—å?','Currently in your Gallery'=>'–í –Ω–∞—Å—Ç–æ—è—â–µ–µ –≤—Ä–µ–º—è –≤ –≤–∞—à–µ–π –≥–∞–ª–µ—Ä–µ–µ','Mobile'=>'–ú–æ–±–∏–ª—å–Ω—ã–π','Gallery'=>'–ì–∞–ª–µ—Ä–µ—è','Default'=>'–ü–æ —É–º–æ–ª—á–∞–Ω–∏—é','Envira Gallery Code'=>'–ö–æ–¥ –≥–∞–ª–µ—Ä–µ–∏ Envira','Select Files from Your Computer'=>'–í—ã–±—Ä–∞—Ç—å —Ñ–∞–π–ª—ã —Å –≤–∞—à–µ–≥–æ –∫–æ–º–ø—å—é—Ç–µ—Ä–∞','Saved!'=>'–°–æ—Ö—Ä–∞–Ω–µ–Ω–æ!','Are you sure you want to remove these images from the gallery?'=>'–í—ã –¥–µ–π—Å—Ç–≤–∏—Ç–µ–ª—å–Ω–æ —Ö–æ—Ç–∏—Ç–µ —É–¥–∞–ª–∏—Ç—å —ç—Ç–∏ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏—è –∏–∑ –≥–∞–ª–µ—Ä–µ–∏?','Move Media to Selected Gallery'=>'–ü–µ—Ä–µ–º–µ—Å—Ç–∏—Ç—å –º–µ–¥–∏–∞—Ñ–∞–π–ª—ã –≤ –≤—ã–±—Ä–∞–Ω–Ω—É—é –≥–∞–ª–µ—Ä–µ—é','Move Media to Gallery'=>'–ü–µ—Ä–µ–º–µ—Å—Ç–∏—Ç—å –º–µ–¥–∏–∞—Ñ–∞–π–ª—ã –≤ –≥–∞–ª–µ—Ä–µ—é','Adding items to gallery.'=>'–î–æ–±–∞–≤–ª–µ–Ω–∏–µ —ç–ª–µ–º–µ–Ω—Ç–æ–≤ –≤ –≥–∞–ª–µ—Ä–µ—é.','All images uploaded.'=>'–í—Å–µ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏—è –∑–∞–≥—Ä—É–∂–µ–Ω—ã.','of'=>'–∏–∑','Uploading Image'=>'–ó–∞–≥—Ä—É–∑–∫–∞ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏—è','Select Files from Other Sources'=>'–í—ã–±—Ä–∞—Ç—å —Ñ–∞–π–ª—ã –∏–∑ –¥—Ä—É–≥–∏—Ö –∏—Å—Ç–æ—á–Ω–∏–∫–æ–≤','Insert into Gallery'=>'–í—Å—Ç–∞–≤–∏—Ç—å –≤ –≥–∞–ª–µ—Ä–µ—é','The GD or Imagick libraries are not installed on your server. Envira Gallery requires at least one (preferably Imagick) in order to crop images and may not work properly without it. Please contact your webhost and ask them to compile GD or Imagick for your PHP install.'=>'–ù–∞ –≤–∞—à–µ–º —Å–µ—Ä–≤–µ—Ä–µ –Ω–µ —É—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω—ã –±–∏–±–ª–∏–æ—Ç–µ–∫–∏ GD –∏–ª–∏ Imagick. –ì–∞–ª–µ—Ä–µ—è Envira —Ç—Ä–µ–±—É–µ—Ç –∫–∞–∫ –º–∏–Ω–∏–º—É–º –æ–¥–∏–Ω (–∂–µ–ª–∞—Ç–µ–ª—å–Ω–æ Imagick) –¥–ª—è –∫–∞–¥—Ä–∏—Ä–æ–≤–∞–Ω–∏—è –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–π –∏ –º–æ–∂–µ—Ç –Ω–µ —Ä–∞–±–æ—Ç–∞—Ç—å –¥–æ–ª–∂–Ω—ã–º –æ–±—Ä–∞–∑–æ–º –±–µ–∑ –Ω–µ–≥–æ. –°–≤—è–∂–∏—Ç–µ—Å—å —Å –≤–∞—à–∏–º —Ö–æ—Å—Ç–∏–Ω–≥–æ–º –∏ –ø–æ–ø—Ä–æ—Å–∏—Ç–µ –µ–≥–æ —Å–∫–æ–º–ø–∏–ª–∏—Ä–æ–≤–∞—Ç—å GD –∏–ª–∏ Imagick –¥–ª—è –≤–∞—à–µ–π —É—Å—Ç–∞–Ω–æ–≤–∫–∏ PHP.','Upgrade Now'=>'–û–±–Ω–æ–≤–∏—Ç—å —Å–µ–π—á–∞—Å','<strong>Want even more addons?</strong> <a href="%s">Upgrade your Envira Gallery account</a> and unlock the following addons.'=>'<strong>–•–æ—Ç–∏—Ç–µ –µ—â–µ –±–æ–ª—å—à–µ –¥–æ–ø–æ–ª–Ω–µ–Ω–∏–π?</strong><a href="%s">–û–±–Ω–æ–≤–∏—Ç–µ —Å–≤–æ—é —É—á–µ—Ç–Ω—É—é –∑–∞–ø–∏—Å—å Envira Gallery</a> –∏ —Ä–∞–∑–±–ª–æ–∫–∏—Ä—É–π—Ç–µ —Å–ª–µ–¥—É—é—â–∏–µ –¥–æ–ø–æ–ª–Ω–µ–Ω–∏—è.','Unlock More Addons'=>'–†–∞–∑–±–ª–æ–∫–∏—Ä–æ–≤–∞—Ç—å –±–æ–ª—å—à–µ –¥–æ–ø–æ–ª–Ω–µ–Ω–∏–π','Available Addons'=>'–î–æ—Å—Ç—É–ø–Ω—ã–µ –¥–æ–ø–æ–ª–Ω–µ–Ω–∏—è','Refresh Addons'=>'–û–±–Ω–æ–≤–∏—Ç—å –¥–æ–ø–æ–ª–Ω–µ–Ω–∏—è','There was an issue retrieving the addons for this site. Please click on the button below the refresh the addons data.'=>'–í–æ–∑–Ω–∏–∫–ª–∞ –ø—Ä–æ–±–ª–µ–º–∞ —Å –ø–æ–ª—É—á–µ–Ω–∏–µ–º –Ω–∞–¥—Å—Ç—Ä–æ–µ–∫ –¥–ª—è —ç—Ç–æ–≥–æ —Å–∞–π—Ç–∞. –ü–æ–∂–∞–ª—É–π—Å—Ç–∞, –Ω–∞–∂–º–∏—Ç–µ –∫–Ω–æ–ø–∫—É –ø–æ–¥ –æ–±–Ω–æ–≤–ª–µ–Ω–∏–µ–º –¥–∞–Ω–Ω—ã—Ö –Ω–∞–¥—Å—Ç—Ä–æ–π–∫–∏.','In order to get access to Addons, you need to resolve your license key errors.'=>'–ß—Ç–æ–±—ã –ø–æ–ª—É—á–∏—Ç—å –¥–æ—Å—Ç—É–ø –∫ –¥–æ–ø–æ–ª–Ω–µ–Ω–∏—è–º, –Ω–µ–æ–±—Ö–æ–¥–∏–º–æ —É—Å—Ç—Ä–∞–Ω–∏—Ç—å –æ—à–∏–±–∫–∏ –ª–∏—Ü–µ–Ω–∑–∏–æ–Ω–Ω–æ–≥–æ –∫–ª—é—á–∞.','Sort Descending (Z-A)'=>'–°–æ—Ä—Ç–∏—Ä–æ–≤–∫–∞ –ø–æ —É–±—ã–≤–∞–Ω–∏—é (Z-A)','Sort Ascending (A-Z)'=>'–°–æ—Ä—Ç–∏—Ä–æ–≤–∞—Ç—å –ø–æ –≤–æ–∑—Ä–∞—Å—Ç–∞–Ω–∏—é (A-Z)','Search Envira Addons'=>'–ü–æ–∏—Å–∫ –¥–æ–ø–æ–ª–Ω–µ–Ω–∏–π Envira','Addons'=>'–î–æ–ø–æ–ª–Ω–µ–Ω–∏—è','Envira Gallery Addons'=>'–î–æ–ø–æ–ª–Ω–µ–Ω–∏—è –¥–ª—è –≥–∞–ª–µ—Ä–µ–∏ Envira','Envira Gallery '=>'–ì–∞–ª–µ—Ä–µ–∏ Envira ','No images were selected to be moved between Galleries.'=>'–ò–∑–æ–±—Ä–∞–∂–µ–Ω–∏—è –Ω–µ –≤—ã–±—Ä–∞–Ω—ã –¥–ª—è –ø–µ—Ä–µ–º–µ—â–µ–Ω–∏—è –º–µ–∂–¥—É –≥–∞–ª–µ—Ä–µ—è–º–∏.','The From Gallery ID has not been specified.'=>'ID –≥–∞–ª–µ—Ä–µ–∏ –Ω–µ —É–∫–∞–∑–∞–Ω.','Once done, click the Move button, and the selected images will be moved to the chosen Gallery.'=>'–ü–æ—Å–ª–µ —ç—Ç–æ–≥–æ –Ω–∞–∂–º–∏—Ç–µ –∫–Ω–æ–ø–∫—É –ü–µ—Ä–µ–º–µ—Å—Ç–∏—Ç—å, –∏ –≤—ã–±—Ä–∞–Ω–Ω—ã–µ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏—è –±—É–¥—É—Ç –ø–µ—Ä–µ–º–µ—â–µ–Ω—ã –≤ –≤—ã–±—Ä–∞–Ω–Ω—É—é –ì–∞–ª–µ—Ä–µ—é.','Select the Gallery to move the selected images to by clicking on one of the boxes to the left.'=>'–í—ã–±–µ—Ä–∏—Ç–µ –≥–∞–ª–µ—Ä–µ—é, –≤ –∫–æ—Ç–æ—Ä—É—é –Ω—É–∂–Ω–æ –ø–µ—Ä–µ–º–µ—Å—Ç–∏—Ç—å –≤—ã–±—Ä–∞–Ω–Ω—ã–µ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏—è, –Ω–∞–∂–∞–≤ –Ω–∞ –æ–¥–Ω–æ –∏–∑ –ø–æ–ª–µ–π —Å–ª–µ–≤–∞.','Save Metadata to Items'=>'–°–æ—Ö—Ä–∞–Ω—è—Ç—å –º–µ—Ç–∞–¥–∞–Ω–Ω—ã–µ –≤ —ç–ª–µ–º–µ–Ω—Ç–∞—Ö','Captions can take any type of HTML, and are displayed when an image is clicked.'=>'–ü–æ–¥–ø–∏—Å–∏ –º–æ–≥—É—Ç –ø—Ä–∏–Ω–∏–º–∞—Ç—å –ª—é–±–æ–π —Ç–∏–ø HTML –∏ –æ—Ç–æ–±—Ä–∞–∂–∞—é—Ç—Å—è –ø—Ä–∏ –Ω–∞–∂–∞—Ç–∏–∏ –Ω–∞ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–µ.','Caption'=>'–ü–æ–¥–ø–∏—Å—å','Bulk Edit'=>'–ú–∞—Å—Å–æ–≤–æ–µ —Ä–µ–¥–∞–∫—Ç–∏—Ä–æ–≤–∞–Ω–∏–µ','Saved.'=>'–°–æ—Ö—Ä–∞–Ω–µ–Ω–æ.','Opens your image links in a new browser window / tab.'=>'–û—Ç–∫—Ä—ã–≤–∞–µ—Ç —Å—Å—ã–ª–∫–∏ –Ω–∞ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏—è –≤ –Ω–æ–≤–æ–º –≤–∫–ª–∞–¥–∫–µ/–æ–∫–Ω–µ –±—Ä–∞—É–∑–µ—Ä–∞.','Open URL in New Window?'=>'–û—Ç–∫—Ä—ã–≤–∞—Ç—å URL –≤ –Ω–æ–≤–æ–º –æ–∫–Ω–µ?','Enter a hyperlink if you wish to link this image to somewhere other than its full size image.'=>'–í–≤–µ–¥–∏—Ç–µ –≥–∏–ø–µ—Ä—Å—Å—ã–ª–∫—É, –µ—Å–ª–∏ –≤—ã —Ö–æ—Ç–∏—Ç–µ —Å–≤—è–∑–∞—Ç—å —ç—Ç–æ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–µ –Ω–µ —Å –ø–æ–ª–Ω–æ—Ä–∞–∑–º–µ—Ä–Ω—ã–º –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–µ–º.','Attachment Page'=>'–°—Ç—Ä–∞–Ω–∏—Ü–∞ –≤–ª–æ–∂–µ–Ω–∏—è','Media File'=>'–ú–µ–¥–∏–∞—Ñ–∞–π–ª','URL'=>'URL','Very important for SEO, the Alt Text describes the image.'=>'–î–ª—è SEO –æ—á–µ–Ω—å –≤–∞–∂–µ–Ω –∑–∞–º–µ—â–∞—é—â–∏–π —Ç–µ–∫—Å—Ç (Alt), –æ–ø–∏—Å—ã–≤–∞—é—â–∏–π –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–µ.','Alt Text'=>'–ê—Ç—Ä–∏–±—É—Ç alt','Edit next media item'=>'–ò–∑–º–µ–Ω–∏—Ç—å —Å–ª–µ–¥—É—é—â–∏–π –º–µ–¥–∏–∞-—ç–ª–µ–º–µ–Ω—Ç','Edit previous media item'=>'–ò–∑–º–µ–Ω–∏—Ç—å –ø—Ä–µ–¥—ã–¥—É—â–∏–π –º–µ–¥–∏–∞-—ç–ª–µ–º–µ–Ω—Ç','Prepends each inserted Gallery with the Gallery Title.'=>