–Ω–æ–≤–∏—Ç—å','Status: Inactive'=>'–°—Ç–∞—Ç—É—Å: –ù–µ–∞–∫—Ç–∏–≤–Ω—ã–π','Deactivating...'=>'–î–µ–∞–∫—Ç–∏–≤–∞—Ü–∏—è‚Ä¶','Deactivate'=>'–î–µ–∞–∫—Ç–∏–≤–∏—Ä–æ–≤–∞—Ç—å','Activating...'=>'–ê–∫—Ç–∏–≤–∞—Ü–∏—è...','Activate'=>'–ê–∫—Ç–∏–≤–∏—Ä–æ–≤–∞—Ç—å','Status: Active'=>'–°—Ç–∞—Ç—É—Å: –ê–∫—Ç–∏–≤–Ω—ã–π','Envira Gallery Team'=>'–ö–æ–º–∞–Ω–¥–∞ Envira Gallery','http://enviragallery.com'=>'http://enviragallery.com','Previous'=>'–ü—Ä–µ–¥—ã–¥—É—â–∏–π','Next'=>'–î–∞–ª–µ–µ','Close'=>'–ó–∞–∫—Ä—ã—Ç—å','Add New'=>'–î–æ–±–∞–≤–∏—Ç—å –Ω–æ–≤–æ–µ','Envira Gallery'=>'–ì–∞–ª–µ—Ä–µ–∏ Envira','The dimensions of the original image could not be retrieved for cropping.'=>'–†–∞–∑–º–µ—Ä—ã –∏—Å—Ö–æ–¥–Ω–æ–≥–æ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏—è –Ω–µ–≤–æ–∑–º–æ–∂–Ω–æ –≤–æ—Å—Å—Ç–∞–Ω–æ–≤–∏—Ç—å –¥–ª—è –æ–±—Ä–µ–∑–∫–∏.','No file could be found for the image URL specified.'=>'–ü–æ –¥–∞–Ω–Ω–æ–π —Å—Å—ã–ª–∫–µ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–π –Ω–µ –Ω–∞–π–¥–µ–Ω–æ.','No image URL specified for cropping.'=>'–ü–æ –¥–∞–Ω–Ω–æ–π —Å—Å—ã–ª–∫–µ –Ω–µ –Ω–∞–π–¥–µ–Ω–æ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–π –¥–ª—è –æ–±—Ä–µ–∑–∫–∏.','No image editor could be selected. Please verify with your webhost that you have either the GD or Imagick image library compiled with your PHP install on your server.'=>'–ù–µ—Ç —Ä–µ–¥–∞–∫—Ç–æ—Ä–∞ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–π. –ü–æ–∂–∞–ª—É–π—Å—Ç–∞, –ø—Ä–æ–≤–µ—Ä—å—Ç–µ –Ω–∞–ª–∏—á–∏–µ —Ñ–æ—Ç–æ–≥–∞–ª–µ—Ä–µ–∏ GD –∏–ª–∏ Imagick, —Å–æ–±—Ä–∞–Ω–Ω—ã—Ö —Å –≤–∞—à–∏–º PHP –∏ —É—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–Ω—ã—Ö –Ω–∞ –≤–∞—à —Å–µ—Ä–≤–µ—Ä–µ.','Float (Wrapped)'=>'–ü–ª–∞–≤–∞—é—â–∏–π (–ü–µ—Ä–µ–Ω–æ—Å)','Float'=>'–ü–ª–∞–≤–∞—é—â–∏–π','Base'=>'–û—Å–Ω–æ–≤–∞','Six Columns (6)'=>'–®–µ—Å—Ç—å –∫–æ–ª–æ–Ω–æ–∫ (6)','Five Columns (5)'=>'–ü—è—Ç—å –∫–æ–ª–æ–Ω–æ–∫ (5)','Four Columns (4)'=>'–ß–µ—Ç—ã—Ä–µ –∫–æ–ª–æ–Ω–∫–∏ (4)','Three Columns (3)'=>'–¢—Ä–∏ –∫–æ–ª–æ–Ω–∫–∏ (3)','Two Columns (2)'=>'–î–≤–µ –∫–æ–ª–æ–Ω–∫–∏ (2)','One Column (1)'=>'–û–¥–Ω–∞ –∫–æ–ª–æ–Ω–∫–∞ (1)','Envira gallery draft updated.'=>'–ü—Ä–æ–µ–∫—Ç –≥–∞–ª–µ—Ä–µ–∏ Envira –æ–±–Ω–æ–≤–ª–µ–Ω.','M j, Y @ G:i'=>'M j, Y @ G:i','Envira gallery scheduled for: <strong>%1$s</strong>.'=>'–ì–∞–ª–µ—Ä–µ—è Envira, –Ω–∞–º–µ—á–µ–Ω–Ω–∞—è –¥–ª—è: <strong>%1$s</strong>.','Envira gallery submitted.'=>'–ì–∞–ª–µ—Ä–µ—è Envira –ø—Ä–µ–¥—Å—Ç–∞–≤–ª–µ–Ω–∞.','Envira gallery saved.'=>'–ì–∞–ª–µ—Ä–µ—è Envira —Å–æ—Ö—Ä–∞–Ω–µ–Ω–∞.','Envira gallery published.'=>'–ì–∞–ª–µ—Ä–µ—è Envira –æ–ø—É–±–ª–∏–∫–æ–≤–∞–Ω–∞.','Envira gallery restored to revision from %s.'=>'–ì–∞–ª–µ—Ä–µ—è Envira –≤–æ—Å—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∞ –¥–æ –≤–µ—Ä—Å–∏–∏ %s.','Envira gallery custom field deleted.'=>'–ü–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å—Å–∫–æ–µ –ø–æ–ª–µ –≥–∞–ª–µ—Ä–µ–∏ Envira —É–¥–∞–ª–µ–Ω–æ.','Envira gallery custom field updated.'=>'–û–±–Ω–æ–≤–ª–µ–Ω–∏–µ –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å—Å–∫–æ–≥–æ –ø–æ–ª—è –≥–∞–ª–µ—Ä–µ–∏ Envira.','Envira gallery updated.'=>'–ì–∞–ª–µ—Ä–µ—è Envira –æ–±–Ω–æ–≤–ª–µ–Ω–∞.','Date'=>'–î–∞—Ç–∞','Last Modified'=>'–ü–æ—Å–ª–µ–¥–Ω–µ–µ –∏–∑–º–µ–Ω–µ–Ω–∏–µ','Shortcode'=>'–®–æ—Ä—Ç–∫–æ–¥','Title'=>'–ó–∞–≥–æ–ª–æ–≤–æ–∫','Save Metadata'=>'–°–æ—Ö—Ä–∞–Ω–∏—Ç—å –ú–µ—Ç–∞–¥–∞–Ω–Ω—ã–µ','Image titles can take any type of HTML. You can adjust the position of the titles in the main Lightbox settings.'=>'–ó–∞–≥–æ–ª–æ–≤–∫–∏ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–π –º–æ–≥—É—Ç –ø—Ä–∏–Ω–∏–º–∞—Ç—å –ª—é–±–æ–π –≤–∏–¥ HTML. –í—ã –º–æ–∂–µ—Ç–µ –Ω–∞—Å—Ç—Ä–æ–∏—Ç—å –ø–æ–ª–æ–∂–µ–Ω–∏–µ –∑–∞–≥–æ–ª–æ–≤–∫–æ–≤ –≤ –æ—Å–Ω–æ–≤–Ω—ã—Ö –Ω–∞—Å—Ç—Ä–æ–π–∫–∞—Ö Lightbox.','Image Files'=>'–§–∞–π–ª—ã –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–π','Edit Metadata'=>'–ò–∑–º–µ–Ω–∏—Ç—å –º–µ—Ç–∞–¥–∞–Ω–Ω—ã–µ','Modify Image'=>'–ò–∑–º–µ–Ω–∏—Ç—å –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–µ','Remove Image from Gallery?'=>'–£–±—Ä–∞—Ç—å –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–µ –∏–∑ –≥–∞–ª–µ—Ä–µ–∏?','Enables or disables RTL support in Envira for right-to-left languages.'=>'–í–∫–ª—é—á–∞–µ—Ç –∏–ª–∏ –æ—Ç–∫–ª—é—á–∞–µ—Ç –ø–æ–¥–¥–µ—Ä–∂–∫—É RTL –≤ Envira –¥–ª—è —è–∑—ã–∫–æ–≤ —Å –ø–∏—Å—å–º–æ–º —Å–ø—Ä–∞–≤–∞ –Ω–∞–ª–µ–≤–æ.','Enable RTL Support?'=>'–í–∫–ª—é—á–∏—Ç—å –ø–æ–¥–¥–µ—Ä–∂–∫—É RTL?','Adds custom CSS classes to this gallery. Enter one class per line.'=>'–î–æ–±–∞–≤–ª—è–µ—Ç –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å—Å–∫–∏–µ –∫–ª–∞—Å—Å